import React, { Component } from 'react';
import Img from 'react-image'

class Container extends Component {

    render() {

        return (
            <div>
                <h5>Should show</h5>
                <Img style={{ width: 800 }} src={this.props.img} loader={'Fick'} decode={false} />
            </div>
        );
    }
}

export default Container;
